  `created_at` int(11) DEFAULT NULL,
  PRIMARY KEY (`item_name`,`user_id`),
  CONSTRAINT `t_sp_auth_assignment_ibfk_1` FOREIGN KEY (`item_name`) REFERENCES `t_sp_auth_item` (`name`) ON DELETE CASCADE ON UPDATE CASCADE
